    fun callAPI(taleEmbed: TaleEmbed, intent:Intent){

        val call = apiService.getSynVoice(taleEmbed)
        call.enqueue(object: Callback<TaleWithSynVoice> {

            override fun onResponse(call: Call<TaleWithSynVoice>, response: Response<TaleWithSynVoice>) {
                if (response.isSuccessful) {
                    var responseBody = response.body()
                    var synVoices = responseBody?.synVoice
                    var id = responseBody?.tale_id
                    Log.i("API SynVoice", synVoices.toString());


                    convertAndSaveAudio(id!!,synVoices!!)
                    var textList = loopAddList(synVoices)
                    saveList(id!!,textList)
                    Log.i("textList", textList.toString())

                    intent.putStringArrayListExtra("textList",textList);

                    context.startActivity(intent)
                    Log.i("API Get SynVoice", "start activity");

                } else {
                    Log.e("API Get SynVoice error" , response.toString())
                }
            }

            override fun onFailure(call: Call<TaleWithSynVoice>, t: Throwable) {
                Log.e("API Get Syn Voice Fail" , t.message + " "+ t.cause)
                callAPI(taleEmbed,intent)
            }
        })
    }
    private fun loopAddList(list:List<SynVoice>): ArrayList<String> {
        var newList = ArrayList<String>()
        for (obj in list){
