    private fun getTextList(id:Int):ArrayList<String>{
        // Read the JSON file from the emulator's internal storage
//        val storyString: String = readFiletoString("story_${id}.txt")
//
//        val list = storyString
//            .substring(1, storyString.length - 1) // Remove the "[" and "]" characters
//            .split(",") // Split the string by commas
//            .map { it.trim() } // Remove any extra whitespace around the elements
//            .toCollection(ArrayList()) // Convert the list to an ArrayList
        val file = File(context.filesDir, "story_${id}.txt")

        val list = arrayListOf<String>()

        if (file.exists()) {
            val fileReader = FileReader(file)
            val bufferedReader = BufferedReader(fileReader)

            var line: String?
            while (bufferedReader.readLine().also { line = it } != null) {
                list.add(line!!)
            }

            bufferedReader.close()
            fileReader.close()
        }

        return list
    }

    private fun checkExistFiles(id:Int):Boolean{
        var status = false
        var fileNumber = 0
        var fileName = "SynVoice_$fileNumber.mp3"
        var file =
            File(Environment.getExternalStorageDirectory().absolutePath + "/sdcard/Audio/" + id + "/" + fileName)
        val parentDir = file.parentFile
        Log.i("parent dir", parentDir.toString())

        if (parentDir.isDirectory && parentDir.listFiles().isNotEmpty()) {
            status = true
        }

        return status

    }
    private fun convertAndSaveAudio(id: Int,synlist : List<SynVoice>) {

        var fileNumber = 0
        var fileName = "SynVoice_$fileNumber.mp3"
        var file =
            File(Environment.getExternalStorageDirectory().absolutePath + "/sdcard/Audio/" + id + "/" + fileName)
        val parentDir = file.parentFile
        if (!parentDir.exists()) {
            parentDir.mkdirs()
        } else if (parentDir.exists() && parentDir.isDirectory) {
            //delete all file in folder
            parentDir.listFiles()?.forEach { file ->
                file.delete()
                Log.i("files exist","delete!!")
            }
        }

        //loop save file
        for(TextAndSyn in synlist) {
            //convert base64
            val base64String = TextAndSyn.synVoice
            val audioData = Base64.decode(base64String, Base64.DEFAULT)

            while (file.exists()) {
                fileNumber++
                fileName = "SynVoice_$fileNumber.mp3"
                file =
                    File(Environment.getExternalStorageDirectory().absolutePath + "/sdcard/Audio/" + id + "/" + fileName)
            }
            file.createNewFile()
            val outputStream = FileOutputStream(file)
            outputStream.write(audioData)
            outputStream.close()
        }
    }
